import React from 'react';

const data = [
  { id: 1, name: 'John Doe', age: 28, city: 'New York' },
  { id: 2, name: 'Jane Smith', age: 34, city: 'San Francisco' },
  { id: 3, name: 'Sam Green', age: 22, city: 'Chicago' },
  { id: 4, name: 'Alice Brown', age: 29, city: 'Seattle' }
];

function App() {
  return (
    <div style={{ padding: 20 }}>
      <h1>User Information Table</h1>
      <table border="1" cellPadding="10" cellSpacing="0">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Age</th>
            <th>City</th>
          </tr>
        </thead>
        <tbody>
          {data.map(user => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.age}</td>
              <td>{user.city}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
